import React from "react";
import { useNavigate } from "react-router-dom";


const Buttons = () => {

    const navigate = useNavigate();

    const handleEasy = () => {
        const LinkTo = '/';
        navigate(LinkTo);
    }

    return (
        <>
            <div className="buttons">
                <div className="button"
                    onClick={() => handleEasy()}>
                    New Game</div>
            </div>
        </>
    )
}
export default Buttons
